query:
fragment PluginFragment on Plugin {
  id
  name
  description
  active
  __typename
}

query Plugins($first: Int, $after: String, $last: Int, $before: String, $filter: PluginFilterInput, $sort: PluginSortingInput) {
  plugins(before: $before, after: $after, first: $first, last: $last, filter: $filter, sortBy: $sort) {
    edges {
      node {
        ...PluginFragment
        __typename
      }
      __typename
    }
    pageInfo {
      hasPreviousPage
      hasNextPage
      startCursor
      endCursor
      __typename
    }
    __typename
  }
}
